import React from 'react';
import { Text, View,SafeAreaView } from 'react-native';

const SignUp = () => {
  return (
    <SafeAreaView
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center"
      }}>
      <Text>Hello, world!</Text>
    </SafeAreaView>
  )
}
export default SignUp
